import styles from "./RightSideBar.module.css"
import {motion} from 'framer-motion'

function RightSideBar() {
  return (
    <div>
        <a className={styles.mail} href="mailto:andresriera9999@gmail.com" target="_blank" rel="noopener noreferrer">andresriera9999@gmail.com</a>
    </div>
  );
}

export default RightSideBar;
